%[text] # TP1
%%
%[text] ## Exo 1
clear;
Table = readtable('yield_curves.csv');
years = linspace(0.25,30,120);
% 3/7, 4/7, 4/7, 4/7, 2/7, 2/7, 2/7, 2/7, 4/7, 4/7
dates_juillet = [datetime(1990,7,3), datetime(1995,7,4), datetime(2000,7,4), datetime(2005,7,4), datetime(2009,7,2), datetime(2015,7,2), datetime(2019,7,2), datetime(2021,7,2), datetime(2022,7,4), datetime(2023,7,4)];
rows = ismember(Table.Date, dates_juillet);
Table_juillet = Table(rows, 1:121);
for i = 1:width(Table_juillet)
    if iscell(Table_juillet.(i))
        Table_juillet.(i) = str2double(Table_juillet.(i));
    end
end

Table_juillet %[output:47d19e29]

data  = Table_juillet{:,2:121};          


fig = figure('Position', [100 100 1200 700]);     %[output:5aa434c0]
ax = gca; %[output:5aa434c0]
ax.Position = [0.1 0.2 0.8 0.7];  %[output:5aa434c0]

cmap = turbo(size(data,1));
hold on; %[output:5aa434c0]
for i = 1:size(data,1)
    plot(years, data(i,:), 'LineWidth', 1.5, 'Color', cmap(i,:)); %[output:5aa434c0]
end
hold off; %[output:5aa434c0]



lgd = legend(ax, string(dates_juillet),NumColumns=5); %[output:5aa434c0]
lgd.Color = 'w'; %[output:5aa434c0]
lgd.TextColor = 'k'; %[output:5aa434c0]
lgd.Box = 'off'; %[output:5aa434c0]

% Position legend manually (normalized figure coordinates)
lgd.Units = 'normalized';
lgd.Position = [0.25 0.03 0.5 0.05];  % [left bottom width height] %[output:5aa434c0]

xlabel('Maturité (0.25 à 30 ans, step=0.25)'); %[output:5aa434c0]
ylabel('Rendement (en %, 0.05 = 5%)'); %[output:5aa434c0]
t = title('Courbes zéro-coupon établies à partir des prix des bons du Trésor et des obligations du gouvernement canadien'); %[output:5aa434c0]
t.Units = 'normalized'; %[output:5aa434c0]
t.Position(2) = t.Position(2) + 0.02; %[output:5aa434c0]
grid on; %[output:5aa434c0]

%%
%[text] ## Exo 2
clear;
% Deviation CIP
TableCIP = readtable('InterestRateParityData.xlsx');
Spot_mid = TableCIP.PX_MID;
Forward_mid = TableCIP.PX_MID_2;
i_eur = TableCIP.PX_LAST;
i_usd = TableCIP.PX_LAST_1;

devi_CIP = (Forward_mid ./ Spot_mid) - ((1+i_usd/400) ./ (1+i_eur/400));
% devi_CIP = ((Forward_mid ./ Spot_mid) .* (1+i_eur/400)) - (1+i_usd/400);


fig = figure('Position', [100 100 1200 700]);     %[output:17ca53d8]
ax = gca; %[output:17ca53d8]
ax.Position = [0.1 0.2 0.8 0.7];  %[output:17ca53d8]

hold on; %[output:17ca53d8]
plot(TableCIP.Date, devi_CIP, 'LineWidth', 1); %[output:17ca53d8]
hold off; %[output:17ca53d8]


xlabel('Date'); %[output:17ca53d8]
ylabel('Valeur déviation'); %[output:17ca53d8]
t = title('Courbe déviation CIP entre USD-EUR, terme à 3 mois'); %[output:17ca53d8]
t.Units = 'normalized'; %[output:17ca53d8]
t.Position(2) = t.Position(2) + 0.05; %[output:17ca53d8]
grid on; %[output:17ca53d8]

% Strat version 1

usd_emprunte = 100;
valeur_euro = usd_emprunte ./ Spot_mid;
investment_en_euro = valeur_euro .* (1+i_eur/400);
investment_en_usd = investment_en_euro .* Forward_mid;
profit_v1 = investment_en_usd - (usd_emprunte .* (1+i_usd/400));


fig = figure('Position', [100 100 1200 700]);     %[output:2409880d]
ax = gca; %[output:2409880d]
ax.Position = [0.1 0.2 0.8 0.7];  %[output:2409880d]

hold on; %[output:2409880d]
plot(TableCIP.Date, profit_v1, 'LineWidth', 1); %[output:2409880d]
hold off; %[output:2409880d]

xlabel('Date'); %[output:2409880d]
ylabel("Profit d'arbitrage"); %[output:2409880d]
t = title("Courbe profit d'arbitrage de la stratégie (Forward Mid et Spot Mid)"); %[output:2409880d]
t.Units = 'normalized'; %[output:2409880d]
t.Position(2) = t.Position(2) + 0.05; %[output:2409880d]
grid on; %[output:2409880d]


fprintf('Nombre de dates avec profit: %d\n', sum(profit_v1>=0)); %[output:330c7b78]


% Strat version 2
Spot_ask = TableCIP.PX_ASK;
Forward_bid = TableCIP.PX_BID_2;


usd_emprunte = 100;
valeur_euro = usd_emprunte ./ Spot_ask;
investment_en_euro = valeur_euro .* (1+i_eur/400);
investment_en_usd = investment_en_euro .* Forward_bid;
profit_v2 = investment_en_usd - (usd_emprunte .* (1+i_usd/400));

fig = figure('Position', [100 100 1200 700]);     %[output:010e5204]
ax = gca; %[output:010e5204]
ax.Position = [0.1 0.2 0.8 0.7];  %[output:010e5204]

hold on; %[output:010e5204]
plot(TableCIP.Date, profit_v2, 'LineWidth', 1); %[output:010e5204]
hold off; %[output:010e5204]


xlabel('Date'); %[output:010e5204]
ylabel("Profit d'arbitrage"); %[output:010e5204]
t = title("Courbe profit d'arbitrage de la stratégie (Forward Bid et Spot Ask)"); %[output:010e5204]
t.Units = 'normalized'; %[output:010e5204]
t.Position(2) = t.Position(2) + 0.05; %[output:010e5204]
grid on; %[output:010e5204]

fprintf('Nombre de dates avec profit: %d\n', sum(profit_v2>=0)); %[output:60bc8af4]



%%
%[text] ## Exo 3
clear;

TableCIP = readtable('InterestRateParityData.xlsx');
TableCIP.LogDiffForwardSpot = log(TableCIP.PX_MID_2) - log(TableCIP.PX_MID);
TableCIP.DiffExRate = (TableCIP.PX_LAST_1 - TableCIP.PX_LAST)./400;

TableCIP_before = TableCIP(TableCIP.Date < datetime(2008,1,1),:);
TableCIP_after = TableCIP(TableCIP.Date >= datetime(2008,1,1),:);


lm_before = fitlm(TableCIP_before, "LogDiffForwardSpot~DiffExRate") %[output:6068d633]

lm_after = fitlm(TableCIP_after, "LogDiffForwardSpot~DiffExRate") %[output:2fb885d8]


abs((1.0121-1)/lm_before.Coefficients.SE(2,1)) %[output:37575e3e]
abs((0.83795-1)/lm_after.Coefficients.SE(2,1)) %[output:978a48f4]

fprintf('p_value beta_before: %f\n', 2*(1 - tcdf(abs((1.0121-1)/lm_before.Coefficients.SE(2,1)), 1562))); %[output:0a2fd6cd]
fprintf('p_value beta_after: %f\n', 2*(1 - tcdf(abs((0.83795-1)/lm_after.Coefficients.SE(2,1)), 1954))); %[output:4f2e6f52]

fprintf('p_value DW-test before: %f\n',lm_before.dwtest) %[output:10b5f051]
fprintf('p_value DW-test after: %f\n',lm_after.dwtest) %[output:70ff42fe]

